    public function forwarding ($request)
    {
        $aClient    = hbm_logged_client();
        $clientId   = isset($aClient['id']) ? $aClient['id'] : 0;

        $domainId       = isset($request['domainId']) ? $request['domainId'] : 0;
        $cloak          = isset($request['cloak']) ? $request['cloak'] : 0;
        $domain_name    = isset($request['domain_name']) ? $request['domain_name'] : '';
        $protocal       = isset($request['protocal']) ? $request['protocal'] : 'https';
        $url_forwarding = isset($request['url_forwarding']) ? $request['url_forwarding'] : '';
        $googlecode     = isset($request['googlecode']) ? $request['googlecode'] : '';

        $aData      = array();

        $isClientDomain = domainhandle_model::singleton()->isClientDomain($clientId, $domainId, $domain_name);

        if (! $isClientDomain) {
            $aData['error'] = 'คุณไม่ได้รับสิทธิ์ในการทำรายการสำหรับโดเมน '. $domain_name;
            $this->loader->component('template/apiresponse', 'json');
            $this->json->assign('data', $aData);
            $this->json->show();
        }

        preg_match('/([^\.]+)(\..*)/', $domain_name, $match);

        $sld        = isset($match[1]) ? $match[1] : '';
        $tld        = isset($match[2]) ? $match[2] : '';
        $aData      = array(
            'domain'    => $sld,
            'tld'       => $tld,
            'urlforwarding'     => $protocal .'://'. $url_forwarding,
            'cloak'             => $cloak,
            'googlecode'        => $googlecode,
        );
        domainhandle_model::singleton()->addDomainForwarding($aData);

        $aData['info'] = 'ดำเนินการเรียบร้อย';

        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', $aData);
        $this->json->show();
    }
    
