    public function updateNameserver ($request, $domainId = 0)
    {
        require_once(APPDIR . 'class.config.custom.php');
        require_once(APPDIR . 'class.general.custom.php');
        require_once(APPDIR . 'class.api.custom.php');
        require_once(APPDIR .'modules/Site/zendeskhandle/user/class.zendeskhandle_controller.php');
        
        $adminUrl   = GeneralCustom::singleton()->getAdminUrl();
        $apiCustom  = ApiCustom::singleton($adminUrl.'/api.php');
        
        $db         = hbm_db();
        $admin      = hbm_logged_admin();
        $oAdmin     = isset($admin['id']) ? $admin : null;
        $client     = hbm_logged_client();
        $oClient    = (object) $client;

        $domainId       = isset($request['domainId']) ? $request['domainId'] : 0;
        $whosNS         = isset($request['whosns']) ? $request['whosns'] : '';
        
        /* --- ถ้าใช้ nameserver กับเรา --- */
        if ($whosNS == 'ours') {
            $aNameserver    = array('ns1.netwaygroup.com', 'ns2.netwaygroup.com');
        } else {
            $aNameserver    = isset($request['nameservers']) ? $request['nameservers'] : array();
        }
        
        $aNameserver    = array_map('trim', $aNameserver);
        $aNameserver    = array_filter($aNameserver);
        
        $result     = $db->query("
                SELECT
                    d.id, d.name, d.nameservers
                FROM
                    hb_domains d
                WHERE
                    d.id = :domainId
                    AND d.client_id = :clientId
                ", array(
                    ':domainId'     => $domainId,
                    ':clientId'     => $oClient->id
                ))->fetch();
        if (! isset($result['id'])) {
            echo json_encode(array('result' => array('success' => '')));
            exit;
        }
        
        $domainName         = $result['name'];
        
        $aCurrentNameserver = explode('|',$result['nameservers']);
        $aCurrentNameserver = array_filter($aCurrentNameserver);
        
        sort($aNameserver);
        sort($aCurrentNameserver);
        
        if ($aNameserver == $aCurrentNameserver) {
            echo json_encode(array('result' => array('success' => '1')));
            exit;
        }
        
        $subject    = 'Client request change nameserver for domain '. $domainName;
        $message        = "
        
            ให้โทรไปตรวจสอบว่า ลูกค้าได้ดำเนินการจริงหรือไม่
            Domain: ". $domainName ."
            Nameserver ก่อน update:
            ". implode(",            \n", $aCurrentNameserver)."
            Nameserver ที่ต้องการ update:
            ". implode(",            \n", $aNameserver)."
            
            ";
        
        $request    = array(
            'url'       => '/search.json?query='. rawurlencode($subject) .'%20type:ticket%20order_by:created%20sort:desc',
            'method'    => 'get',
            'data'      => array()
        );
        $result     = zendeskhandle_controller::singleton()->send($request);
        
        if (isset($result['results']) && count($result['results'])) {
            $aTicket    = $result['results'][0];
            $create     = strtotime($aTicket['created_at']);
            $time       = time() - (60*15);
            if ($create > $time) {
                echo json_encode(array('result' => array('success' => '1')));
                exit;
            }
        }
        
        $aParam     = array(
            'ticket'    => array(
                'subject'       => $subject,
                'comment'       => array(
                    'body'      => $message,
                    'public'    => false,
                )
            )
        );
    
        $request    = array(
            'url'       => '/tickets.json',
            'method'    => 'post',
            'data'      => $aParam
        );
        $result     = zendeskhandle_controller::singleton()->send($request);
        
        echo json_encode(array('result' => array('success' => '1')));
        exit;
    }
    
    public function listDomain ($request)
    {
        $db         = hbm_db();
        $aClient    = hbm_logged_client();
        
        $filter     = isset($request['filter']) ? $request['filter'] : '';
        $page       = isset($request['page']) ? $request['page'] : 1;
        $limit      = isset($request['limit']) ? $request['limit'] : '25';
        $totalpages = isset($request['totalpages']) ? $request['totalpages'] : 0;
        
        
        $sql        = "
            FROM hb_domains
            WHERE client_id = '". $aClient['id'] ."'
            ";
        if ($filter == 'active') {
            $sql    .= "
                AND status IN ('Pending','Pending Registration','Pending Transfer','Active')
                ";
        }
        
        $result     = $db->query("
            SELECT COUNT(*) AS total
            ". $sql ."
            ")->fetch();
        
        $total      = $result['total'];
        $totalpages = ceil($total/$limit);
        $offset     = ($page > 0) ? ($page-1)*$limit : 0;
        
        $result     = $db->query("
            SELECT *
            ". $sql ."
            ORDER BY expires DESC
            LIMIT {$offset},{$limit}
            ")->fetchAll();
        
        $aDatas     = array(
            'total'     => $total,
            'domains'   => $result,
            'page'      => $page,
            'limit'         => $limit,
            'totalpages'    => $totalpages
        );
        
        return $aDatas;
    }
    
    public function totalDomain ($request)
    {
        $db         = hbm_db();
        $request['filter']  = 'active';
        $result     = $this->listDomain($request);
        $total      = isset($result['total']) ? $result['total'] : 0;
        return $total;
    }
    
