    public function updateEppCode($aOrderInfo){
        $db         = hbm_db();
        $orderId   = isset($aOrderInfo['order_id']) ? $aOrderInfo['order_id'] : 0;
        $result     = $db->query("
            SELECT *
            FROM hb_orders
            WHERE id = '{$orderId}'
            ")->fetch();
            
        $invoiceId = isset($result['invoice_id']) ? $result['invoice_id'] : 0;
        
        $result     = $db->query("
            SELECT *
            FROM hb_invoice_items
            WHERE invoice_id = '{$invoiceId}'
            AND type = 'Domain Transfer'
            ")->fetch();
        $domainId = isset($result['item_id']) ? $result['item_id'] : 0;
        
        $db->query("
            UPDATE
                hb_domains
            SET
                epp_code = :epp_code
            WHERE
                id = :domainId
        ", array(
            ':epp_code'         =>  $aOrderInfo['epp_code'] ,
            ':domainId'         =>  $domainId
        ));

    }

    public function getTldId($tld, $sld = ''){
        $db         = hbm_db();

        $categoryId = ($sld && preg_match('/^xn\-\-/i', $sld)) ? 121 : 1;

        $result     = $db->query("
            SELECT id
            FROM hb_products
            WHERE name = :tld
            and category_id = :category_id
            ", array(
                ':tld'          => $tld,
                ':category_id'  => $categoryId,
            ))->fetch();
        
        return $result['id'];
    }
    
    public function getCoupon ($request){
        
        $db         = hbm_db();
        $aReturn    = array();
        $listOrder  = isset($request['listOrder']) ? $request['listOrder'] : json_encode(array());  
        $couponCode = isset($request['couponCode']) ? $request['couponCode'] : '';
        
        $result     = $db->query("
            SELECT *
            FROM hb_coupons
            WHERE code = :code
            ", array(
                ':code' => $couponCode
            ))->fetch();
        
        $discountPrice = 0;    
        if(!empty($result)){
            
            $listOrder =   json_decode($listOrder);
            if(strtotime($result['expires']) >= strtotime(date('Y-m-d')) || $result['expires'] == '0000-00-00'){
            
                if($result['domains'] != ''){
                    $listTldDiscount    =   explode('|', $result['domains']);
                    foreach($listOrder as $key  =>  $value){
                        if($key != 'hosting'){
                            preg_match('/([^.]+)(.*)/i', $key, $match);
                            $domainName       = isset($match[1]) ? $match[1] : '';
                            $tld              = isset($match[2]) ? $match[2] : '';
                            if(in_array($tld , $listTldDiscount)){
                                $listCycleDiscount  =   explode('|', $result['cycles']);
                                if(in_array('tld'.$value->period,$listCycleDiscount)){
                                    if($result['type'] == 'percent'){
                                        $discountPrice +=   ($value->price * $result['value']) / 100;
                                    }else if($result['type'] == 'fixed'){
                                        $discountPrice +=   $result['value'];
                                    }
                                }
                            }
                        }
                    }
                }
            }    
        }

        if($discountPrice > 0){
            $_SESSION['domainordercart']['couponIsValid'] = $couponCode;
        }else{
            unset($_SESSION['domainordercart']['couponIsValid']);
        }
        
        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', array('discountPrice'  =>  $discountPrice));
        $this->json->show();
    }
    
