    public function changeCartDomainIDN ($request)
    {
        $db         = hbm_db();
        $aData      = array();
        $aAdmin     = hbm_logged_admin();

        $domainId   = isset($request['domainId']) ? $request['domainId'] : '';
        $aCart      = isset($_SESSION['Cart'][0][$domainId]) ? $_SESSION['Cart'][0][$domainId] : array();
        $sld        = isset($aCart['sld']) ? $aCart['sld'] : '';
        $tld        = isset($aCart['tld']) ? $aCart['tld'] : '';
        $period     = isset($aCart['period']) ? $aCart['period'] : 1;
        $action     = isset($aCart['action']) ? $aCart['action'] : 'register';

        if (! preg_match('/^xn\-\-/i', $sld)) {
            $this->loader->component('template/apiresponse', 'json');
            $this->json->assign('data', $aData);
            $this->json->show();
        }

        $result     = $this->_listDomainPrice($tld, $sld);
        if (! count($result)) {
            $this->loader->component('template/apiresponse', 'json');
            $this->json->assign('data', $aData);
            $this->json->show();
        }

        foreach ($result as $arr) {
            if ($arr['period'] == $period) {
                $productId  = $arr['product_id'];
                $categoryId = $this->_getCategoryIdByProductId($productId);

                $_SESSION['Cart'][0][$domainId]['tld_id']   = $productId;
                $_SESSION['Cart'][0][$domainId]['tld_cat']  = $categoryId;
                $_SESSION['Cart'][0][$domainId]['price']    = $arr[$action];
                $_SESSION['Cart'][0][$domainId]['renew']    = $arr['renew'];

                break;
            }
        }

        $aData  = $_SESSION['Cart'][0];

        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', $aData);
        $this->json->show();
    }

    public function changeCartIDProtection ($request)
    {
        $db         = hbm_db();
        $aData      = array();
        $aAdmin     = hbm_logged_admin();

        $optionId       = isset($request['optionId']) ? $request['optionId'] : '';
        $optionName     = isset($request['optionName']) ? $request['optionName'] : '';
        $optionValue    = isset($request['optionValue']) ? $request['optionValue'] : '';

        if (! isset($aAdmin['email']) || $aAdmin['email'] != 'prasit@netway.co.th') {
            $this->loader->component('template/apiresponse', 'json');
            $this->json->assign('data', $aData);
            $this->json->show();
        }

        preg_match_all('/(\d+)/', $optionId, $match);
        $catId      = isset($match[1][0]) ? $match[1][0] : 0;
        $cartId     = isset($match[1][1]) ? $match[1][1] : 0;
        preg_match_all('/(\d+)/', $optionName, $match);
        $itemId     = isset($match[1][2]) ? $match[1][2] : 0;

        $aCart      = isset($_SESSION['Cart'][0][$cartId]) ? $_SESSION['Cart'][0][$cartId] : array();
        $period     = isset($aCart['period']) ? $aCart['period'] : 0;

        if (! isset($_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId])) {
            $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId] = array();
        }

        $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId]['val']  = $optionValue;
        $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId]['variable']  = 'idprotection';

        $price      = $this->_getIDProtectionPricebyConfigId($itemId);
        $total      = $price * $period;

        $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId]['price']    = $price;
        $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId]['qty']      = $period;
        $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId]['total']    = $total;
        
        if (! $optionValue) {
            $_SESSION['Cart'][0][$cartId]['forms'][$catId][$itemId] = array();
        }

        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', $aData);
        $this->json->show();
    }

    private function _getIDProtectionPricebyConfigId ($configId)
    {
        $db         = hbm_db();
        $result     = $db->query("
                SELECT
                    price
                FROM
                    hb_prices
                WHERE
                    rel_id = :rel_id
                    AND rel = 'Config'
                    AND type = 'a'
            " , array(
                ':rel_id'   =>  $configId
            ))->fetch();

        $price      = isset($result['price']) ? $result['price'] : 0;
        return $price;
    }

    private function _getCategoryIdByProductId ($productId)
    {
        $db         = hbm_db();
        $result     = $db->query("
                SELECT
                    category_id
                FROM
                    hb_products
                WHERE
                    id = :id
            " , array(
                ':id'      =>  $productId
            ))->fetch();

        $categoryId = isset($result['category_id']) ? $result['category_id'] : 0;
        return $categoryId;
    }
    
    public function updateAddress($param){
        parse_str($param['addressData'], $addressData);
        if(is_array($addressData)){
            $db         = hbm_db();
            $aClient    = hbm_logged_client();
            
            $resultClientAddress =   $db->query("
                SELECT
                    *
                FROM
                    hb_domains
                WHERE
                    client_id = :client_id
                ORDER BY id DESC LIMIT 0,1
            ",array(
                ':client_id'        =>  $aClient['id']
            ))->fetch();
            
            $db->query("
                UPDATE
                    hb_domains
                SET
                    extended = :extended
                WHERE
                    id = :id
            ", array(
                
                ':id'           =>  $resultClientAddress['id'] ,
                ':extended'     =>  serialize($addressData)
                
            ));
        }
        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', array('updateid'    => $resultClientAddress['id']));
        $this->json->show();
    }

