    public function validateDomain($param){
        
        $domain         = isset($param['domainName']) ? $param['domainName'] : '';
        $aReplace       = array(' ', '_', ';', ':', '{', '}' , '(', ')', ',', '\'', '\"', '--');
        $domain         = str_replace($aReplace,'',strtolower($domain));
        //$domain         = IDN::decodeIDN(strtolower($param['domainName']));
        //$response       = file_get_contents('https://netway.co.th/listdomain.json');
        /*$ch = curl_init();

        curl_setopt($ch, CURLOPT_HEADER, 0);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
        curl_setopt($ch, CURLOPT_URL, 'https://netway.co.th/listdomain.json');
    
        $response = curl_exec($ch);
        curl_close($ch);
        $aResponse      = json_decode($response);
        $isError        = 0;
        $errormsg       = '';*/
        
        $response       = file_get_contents(dirname(APPDIR) .'/listdomain.json');
        $aResponse      = json_decode($response);
        $isError        = 0;
        $errormsg       = '';

       
        $aTld           = array();
        foreach($aResponse->tld as $val){
            $aTld[]     = $val->name;
        }
        
        preg_match('/([^.]+)(.*)/i', $domain, $match);
        $domainName       = isset($match[1]) ? $match[1] : '';
        $ext              = isset($match[2]) ? $match[2] : '';

        if(preg_match("/^[a-zA-Z0-9ก-ฮ]+(\.th+)$|\.ไทย/",$ext)){
            
                $resReserve = $this->reserveword($domainName);
                if($resReserve){
                    $errormsg .= "<br> $domainName เป็นคำสงวนไม่สามารถนำมาจดโดเมน .ไทย และ .th ได้";
                    $isError    = 1;
                }
        }else{
            if(!preg_match("/^\.com$|^\.net$/",$ext) && (!preg_match("/^[a-zA-Z0-9]+$/",$domainName))) {

                $errormsg .= "<br>โดเมน  <b>$domainName$ext</b>  ไม่รองรับชื่อภาษาไทย ";
                $isError    = 1;

            } 
        }
        require_once(APPDIR . 'punycode.php');
        $domainName       = Punycode::encode($domainName);
   
        if(empty($domainName)){ 
            $errormsg .= "กรุณาระบุ ชื่อโดเมน";
            $isError    = 1;
        }/*elseif(preg_match("/(^-|-$)|([-]{2})/",$domainName)) {
            $errormsg .= "<br> ชื่อโดเมน $domainName จะต้องไม่ขึ้นต้น หรือลงท้ายด้วย hyphen (ขีดกลาง) หรือมี hyphen (ขีดกลาง) 2 ตัว";
            $isError    = 1;
        }elseif(!preg_match("/^([a-zA-Z0-9]([a-zA-Z0-9-]{0,61}[a-zA-Z0-9]))/",$domainName) || !strlen($domainName)){
            $errormsg .= "<br> ชื่อโดเมน  ($domainName) ชื่อโดเมน ต้องเป็นตัวอักษร หรือตัวเลข หรือ hyphen (ขีดกลาง) เท่านั้น";
            $isError    = 1;
        }*/else if(!in_array(strtolower($ext), $aTld)){
            $errormsg .= "<br> ไม่รองรับ TLD <b>($ext)</b> นี้";
            $isError    = 1;
        } 
        
        if($ext == ''){
            $errormsg = " กรุณาระบุ TLD ที่ท่านต้องการเช่น .com , .net";
            $isError    = 1;
        }
        $originDomain  = idn_to_utf8($domainName);
        return array('error'    =>  $isError , 'errorMsg'   =>  $errormsg , 'sld'   =>  $domainName , 'tld' =>  $ext,'domainName' => $originDomain);
        
    }

    public function orderHostingOnly($param){
        $domain         = isset($param['domainName']) ? $param['domainName'] : '';
        $isError        = 0;
        $errormsg       = '';
        if(! preg_match('/^(?!\-)(?:[a-zA-Z\d\-]{0,62}[a-zA-Z\d]\.){1,126}(?!\d+)[a-zA-Z\d]{1,63}$/',$domain)){
            $isError    = 1;
            $errormsg   = 'Invalid domain format.';
        }else{
            $_SESSION['domainordercart']['hosting']['hostname'] = $domain;
            $_SESSION['domainordercart']['items'][$domain]['period']   =   0;
            $_SESSION['domainordercart']['items'][$domain]['price']    =   0;
            $_SESSION['domainordercart']['items'][$domain]['type']     =   'Dummy';
            $_SESSION['domainordercart']['incart'] = 1;
        }
        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', array('error'    =>  $isError , 'errorMsg'   =>  $errormsg ));
        $this->json->show();
    }

    private function checkNetwayDomain($param){
        
        $db         = hbm_db();
        $result     = $db->query("SELECT 
            id , name 
        FROM 
            hb_domains 
        WHERE
            name = :domainName
            AND status = 'Active'
        " , array(':domainName' =>  $param['sld'].$param['tld']))->fetch();
        
        $result     = isset($result['id']) ? true : false;

        return $result;
        
    }
    
    public function checkWhois($param){
        
        $resValidate    =   $this->validateDomain($param);
        
        if($resValidate['error'] == 0){
            //$resWhois   =   file_get_contents('https://netway.co.th/checkdomain&action=whois&sld='.$resValidate['sld'].'&tld='.$resValidate['tld']);
            
            exec('whois '.$resValidate['sld'].$resValidate['tld'], $resWhois,$return_var);
            $resWhois = implode('<br />', $resWhois);
            if(preg_match('/No Data Found/i', $resWhois) 
            || preg_match('/No match found/i', $resWhois) 
            || preg_match('/No match for domain/i', $resWhois)
            || preg_match('/No match/i', $resWhois)) {
                $resWhois = '';
            }

            $resValidate['response']    = $resWhois;
            if($resValidate['response'] != ''){
                $resNetwayDomain    =   $this->checkNetwayDomain($resValidate);
                    $resValidate['netwayDomain']    =   $resNetwayDomain;
            }
        }
        
        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', $resValidate);
        $this->json->show();
        
    }

    public function orderDomain($param){
        
        $popularTld         =   array('.com','.co.th','.net');
        $resSuggestion      =   array();        
        $resValidate        =   $this->validateDomain($param);
        
        if($resValidate['error'] == 0){
           $sld         = $resValidate['sld'];
           $tld         = $resValidate['tld'];
           $count       = 0;
           if(!in_array($resValidate['tld'], $popularTld)) {
                array_unshift($popularTld, $tld);
           } else {
               array_pop($popularTld, $tld);
               array_unshift($popularTld, $tld);
           }
           $resSuggestion['main']['sld']    =   $sld;
           $resNetwayDomain    =   $this->checkNetwayDomain(array('sld' =>  $sld , 'tld' =>  $tld));
           $resSuggestion['netwayDomain']    =   $resNetwayDomain;
           foreach($popularTld as $tld){
               if ($tld == '.co') {
                continue;
               }
               if ($tld == '.co.th') {
                    if(!preg_match("/^[a-zA-Z0-9]{1,}$/",$sld)) {  
                        continue;  
                    }
                }
               if(preg_match("/\.th|\.ไทย/",$tld)){
               $resReserve = $this->reserveword($sld);
                if($resReserve){
                    continue;
                }
               }
               $count++;
               $ch = curl_init();
               curl_setopt($ch, CURLOPT_URL, "https://". $_SERVER['HTTP_HOST'] ."/RVDomainAjax.php?cmd=checkdomain&register=1&action=checkdomain&singlecheck=1&domain_cat=1&sld={$sld}&tld={$tld}");
               curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
               $output = curl_exec($ch);
               curl_close($ch);  
               $resSuggestion['main']['tld'][$tld] =   0; // 0 ว่าง
               if(preg_match("/unavailable/i", $output)){
                   
                    exec('whois '.$sld.$tld, $resWhois,$return_var);
                    $resWhois = implode(' ', $resWhois);
                    
                   if(preg_match('/No Data Found/i', $resWhois) 
                   || preg_match('/No match found/i', $resWhois) 
                   || preg_match('/No match for domain/i', $resWhois)
                   || preg_match('/No match/i', $resWhois)){

                    $resSuggestion['main']['tld'][$tld] =   0;
                   }else{
                       $resSuggestion['main']['tld'][$tld] =   1;
                    $count--;
                   }
               }

               $resSuggestion['price'][$tld]    =   $this->_listDomainPrice($tld, $sld);
               $resSuggestion['document'][$tld] =   $this->getRegisterDocument($tld);
            }            
          
                
        }else{
            
            $resSuggestion  =   $resValidate;

            
        }    
                
        $this->loader->component('template/apiresponse', 'json');
        $this->json->assign('data', $resSuggestion);
        $this->json->show();        
        
    }
