    private function _listDomainPrice($tld, $sld = ''){
        
        if($tld == '') return array();
        
        $db         = hbm_db();
        
        if (preg_match('/^xn\-\-/i', $sld)) {
        $resultDomain     = $db->query("
            SELECT
                id
            FROM
                `hb_products`
            WHERE
                name = :tld
                AND category_id = '121'
        " , array(
            ':tld'      =>  $tld
        ))->fetch();
        }

        if (! isset($resultDomain['id'])) {
        $resultDomain     = $db->query("
            SELECT
                id
            FROM
                `hb_products`
            WHERE
                name = :tld
                AND category_id = '1'
        " , array(
            ':tld'      =>  $tld
        ))->fetch();
        }

        $resultPrice     = $db->query("
            SELECT
                *
            FROM
                `hb_domain_periods`
            WHERE
                product_id = :product_id
        ",array(':product_id'   =>  $resultDomain['id']))->fetchAll();
        
        return $resultPrice;
        
    }
    
    private function getRegisterDocument($tld){
        
        if($tld == '') return array();
        
        $db         = hbm_db();
        $result     = $db->query("
            SELECT
                id , reg_document , reg_document_kb
            FROM
                `hb_products`
            WHERE
                name = :tld
        " , array(
            ':tld'      =>  $tld
        ))->fetch();
        
        return $result;
        
    }

